import {NavBar} from './NavBar'
import {Banner} from './Banner'
import {ProductsCarousel} from './ProductsCarousel'
import {Footer} from './Footer'

export const Dashboard = () => {
    return(
        <div>
            <NavBar />
            <Banner />
            <ProductsCarousel />
            <Footer />
        </div>
    );
}
